import { hexbin as d3Hexbin } from 'd3-hexbin';

const hexbin = d3Hexbin(); // Instantiate hexbin

export const Marks = ({ bins }) => {
    console.log("Bins passed to Marks:", bins); // Log bins received

    return (
        <g className="marks">
            {bins.map((bin, i) => {
                if (bin.length === 0) {
                    console.log("Empty bin ignored:", i); // Log empty bins
                    return null; // Skip empty bins
                }

                const centroid = hexbin.centroid(bin); // Get the centroid for each bin
                console.log("Centroid for bin:", centroid); // Log centroid for debugging

                return (
                    <path
                        key={i}
                        d={hexbin.hexagon(30)} // Create the hexagon shape
                        transform={`translate(${centroid[0]}, ${centroid[1]})`} // Position the hexagon
                        fill="orange" // Set fill color
                        stroke="black" // Set stroke color
                        strokeWidth={1} // Set stroke width
                    />
                );
            })}
        </g>
    );
};
